import React, { Component } from "react";
import styled from "styled-components";

const FormTable = styled.form`
  margin-left: 25%;
  margin-right: 25%;
  display: grid;
  grid-template-columns: 1fr 1fr;
`;

const SubmitButton = styled.button`
  border: 0;
  color: white;
  background: red;
  margin: 10px;
`;

export default class EmailForm extends Component {
  render() {
    return (
      <div>
        <div>Sesizari (timp de raspuns maxim 48h)</div>
        <FormTable>
          <div>Numee</div>
          <input />
          <div>Last</div>
          <input />
          <div>Numar telefon *</div>
          <input />

          <div>Email *</div>

          <input />
          <div>Adresa *</div>

          <input />
          <div>Va rugam detaliati sesizarea dumneavoastra *</div>
          <textarea />
        </FormTable>
        <SubmitButton>Trimite</SubmitButton>
      </div>
    );
  }
}
